import React from "react";
import { ModalReg } from "../ModalReg/ModalReg";
import cl from "./MyForm.module.css"

export const MyForm=({setModal,setModal1})=> {


    const set=({modal,setModal,setModal1})=>{ 
       setModal(false);
       setModal1(true);
    }
    return( 
        <div className={cl.main}> 
        <input placeholder="Введите Вашем имя" type="name" className={cl.inputs}></input>
        <input placeholder="Введите Ваш e-mail" type="name" className={cl.inputs}></input> 
        <input placeholder="Придумайте парол" type="password" className={cl.inputs}></input>
        <button className={cl.BTN} onClick={set}>Зарегистрироваться</button>
            
        </div>
    )
 }
